import React from 'react';
import ReactDOM from 'react-dom/client'

const TodoList = () => {
  const items = ['Drink Coffe', 'Build Awesome App']

  return(
  <ul>
    <li>{items[0]}</li>
    <li>{items[1]}</li>
  </ul>
  )
}

const AppHeader = () => {
  return <h1>My ToDo List</h1>
}

const SearchPanel = () => {
  const searchText = 'Type here to search';

  return <input placeholder={searchText} />}


const App = () => {

  return(
    <div>
      <AppHeader />
      <SearchPanel />
      <TodoList />
    </div>
  )
}

const mainBlock = document.getElementById('root');
const root = ReactDOM.createRoot(mainBlock);
root.render(<App />)
